$(function(n){$(n).autocomplete({source:function(n,t){$.ajax({url:"/MessageApi/SelectRecruiter",type:"GET",cache:!1,data:n,dataType:"json",success:function(n){t($.map(n,function(n){return{label:n.firstname+" "+n.lastname+" ",value:n.id,image:n.picture}}))}})},focus:function(t,i){return $(n).val(i.item.label),!1},select:function(t,i){return $(n).val(i.item.label),$(n+"Hidden").val(i.item.value),!1}}).data("ui-autocomplete")._renderItem=function(n,t){var i=$("<div><\/div>");return $("<img style='height:76px;'>").attr("src",t.image).appendTo(i),$("<span><\/span>").text(t.label).appendTo(i),$("<li><\/li>").append(i).appendTo(n)}});